import React from 'react';
import './marqueue.css';
import backgroundImage from '../assets/b88e02fde97971aed3161bfc7f6948cb.jpg'; // Import image

const Marqueue = ({ text }) => {
  return (
    <div className="marqueue-container" style={{ backgroundImage: `url(${backgroundImage})` }}>
      <div className="marqueue-text">
        {text}
      </div>
    </div>
  );
}

export default Marqueue;
